import React from "react";

export default function TopLeft() {
  return (
    <div className="TopLeft">
      <div class="row">
        <div class="col-3">
          <span class="selected">Jakarta</span>
        </div>
        <div class="col-3">Beijing</div>
        <div class="col-3">Amsterdam</div>
        <div class="col-3">Hanoi</div>
      </div>
    </div>
  );
}
